import{_ as t,c as n,o,ah as l}from"./chunks/framework.PvdZnrZd.js";const g=JSON.parse('{"title":"SENDLE SHIPPING","description":"SENDLE SHIPPING","frontmatter":{"title":"SENDLE SHIPPING","description":"SENDLE SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/sendle-shipping.md","filePath":"zenith/featured-app/shipping/sendle-shipping.md"}'),a={name:"zenith/featured-app/shipping/sendle-shipping.md"};function i(r,e,p,s,h,c){return o(),n("div",null,[...e[0]||(e[0]=[l('<p><strong><a href="https://www.sendle.com/" target="_blank" rel="noreferrer">Sendle</a>:-</strong> An Australian-based shipping company that provides courier services locally within the country.</p><p>The Sendle shipping is now integrated with the <a href="/zenith/introduction/">Multi-vendor Marketplace App</a> for Shopify to let sellers fulfill their orders via Sendle shipment service and generate shipping labels.</p><p>This feature app costs you a minimal amount of <strong>$10 per month</strong> over and above your current Multivendor plan.</p><p><strong>NOTE</strong>:-</p><ul><li>The Sendle shipping feature app is available only with the Multivendor <strong>Pro</strong> <strong>Plan</strong> ($60/month).</li><li>You need to enable the <strong><a href="/zenith/featured-app/overview.html">Shipping</a></strong> Add-on for FREE from the ‘Feature Apps’ section of the app.</li></ul><p>Moreover, access to Shipping requires your Shopify store to be on the plan that supports <a href="https://help.shopify.com/en/manual/shipping/setting-up-and-managing-your-shipping/enabling-shipping-carriers" target="_blank" rel="noreferrer">Real-Time Carrier-Calculated Shipping.</a></p><h2 id="additional-feature" tabindex="-1">Additional Feature <a class="header-anchor" href="#additional-feature" aria-label="Permalink to &quot;Additional Feature&quot;">​</a></h2><ul><li>A simplest &amp; convenient way to manage shipment via Sendle courier service.</li><li>Both admin and seller can configure their Sendle accounts from their respective panels.</li><li>Allow sellers to generate shipping labels for fulfilled orders.</li><li>Sendle will pick up the order from the seller&#39;s location &amp; deliver it to the customer. Countries for Shipment: Australia (Domestic), Australia (International), USA (Domestic).</li><li>The sellers can configure their shipping packet details from their seller panel.</li></ul><h2 id="how-to-enable-sendle-shipping-feature" tabindex="-1">How to Enable Sendle Shipping Feature? <a class="header-anchor" href="#how-to-enable-sendle-shipping-feature" aria-label="Permalink to &quot;How to Enable Sendle Shipping Feature?&quot;">​</a></h2><p>To enable the feature app, all you need to do is to visit the “<strong>Featured Apps</strong>” section of the admin panel and enable it from there.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/featuredapps.webp" alt="Feature App-shipping"></p><p>Once you click on “Feature Apps”, you will get the list of apps listing in this section. There, You will get the Sendle feature.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/sendle.webp" alt="Screenshot-2020-10-09T094754.158-1"></p><p>You need to click the <strong>&quot;Enable</strong>&quot; button.</p><p>In this way, you can activate the Sendle Shipping feature app within your Multivendor App.</p><h2 id="admin-panel-configuration" tabindex="-1">Admin Panel Configuration <a class="header-anchor" href="#admin-panel-configuration" aria-label="Permalink to &quot;Admin Panel Configuration&quot;">​</a></h2><h3 id="workflow" tabindex="-1">Workflow <a class="header-anchor" href="#workflow" aria-label="Permalink to &quot;Workflow&quot;">​</a></h3><p>Once you enable this feature app, a new sub-menu gets added in the Configuration menu of the app i.e. <strong>Sendle Configuration</strong>.</p><p>In this section, you can enter the URL for sellers to connect to Sendle Shipping. Now, the sellers can create their Sendle account from their respective seller panel.</p><p>Please Note:- It is not mandatory for sellers to create a Sendle account. In case the seller has not connected to Sendle Shipping,</p><p>the shipping will be managed via the admin&#39;s Sendle account details configured in the app.</p><p>Now, you need to enter the Sendle Username and Sendle API Key. Also, enable International Shipping in case you ship internationally.</p><p>You will get these details from your Sendle account.</p><p>Moreover, automatically generate shipping labels.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/sendleconfigadmin.webp" alt="Sendle-Configuration-Admin"></p><p>Click the Save button.</p><h2 id="how-to-get-sendle-id-api-key" tabindex="-1">How to get Sendle ID &amp; API Key? <a class="header-anchor" href="#how-to-get-sendle-id-api-key" aria-label="Permalink to &quot;How to get Sendle ID &amp; API Key?&quot;">​</a></h2><p>Firstly, <strong>Login</strong> to Sendle Shipping: <a href="https://www.sendle.com/users/sign_in" target="_blank" rel="noreferrer">https://www.sendle.com/users/sign_in</a><br> Note:- You need to have an account on <strong>Sendle</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Screenshot-2020-10-09T092858.357.png" alt="Screenshot-2020-10-09T092858.357"></p><p>Once you login to your Sendle account, you will be redirected to the Sendle <a href="https://app.sendle.com/dashboard" target="_blank" rel="noreferrer">Dashboard</a>. Click the <strong>Settings</strong> menu.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Screenshot-2020-10-09T093108.901-1200x594.png" alt="Screenshot-2020-10-09T093108.901"></p><p>In the Settings section, click the &quot;<strong>Integration</strong>&quot; section and there, You will get the Sendle API key. If you don&#39;t get the API key,</p><p><strong>Please contact the Sendle Support to provide access to API.</strong></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Screenshot-2020-10-09T093751.482-1200x561.png" alt="Screenshot-2020-10-09T093751.482"></p><p>Once approved by Sendle, you will get the <strong>API Key and Sendle ID</strong> i.e Username to be configured in the app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Screenshot-2020-10-09T094215.422-1200x549.png" alt="Screenshot-2020-10-09T094215.422"></p><p>That&#39;s how you get the details and configure the same in the app to make Sendle shipping works.</p><h2 id="seller-panel-configuration" tabindex="-1">Seller Panel Configuration <a class="header-anchor" href="#seller-panel-configuration" aria-label="Permalink to &quot;Seller Panel Configuration&quot;">​</a></h2><p>Once you configure these details, the sellers will also get the option to enable the Sendle shipping from the <strong>Shipping Configuration</strong> menu of their seller panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/enablesendleseller.webp" alt="Shipping-Configuration-Seller-•-Multivendor-MarketPlace-2"></p><p>Visiting the Global Configuration menu, the seller can configure the Shipping Packet Details.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/globalconfig.webp" alt="Screenshot-2020-10-07T180133.632"></p><p>Once enabled, the seller can proceed to create his/her Sendle account. (Please Note:- It is not a mandatory step for the sellers to have an account on Sendle).</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/sellersendleconfig.webp" alt="Dashboard-Seller-•-Multivendor-MarketPlace-2"></p><p>Now, the sellers can connect their Sendle accounts and configure the details.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/sellerconfigsendletwo.webp" alt="Sendle-Configuration-Seller-•-Multivendor-MarketPlace"></p><p>Now, the seller can fulfill orders via the Sendle shipping courier service.</p><h2 id="generate-shipping-label" tabindex="-1">Generate Shipping Label <a class="header-anchor" href="#generate-shipping-label" aria-label="Permalink to &quot;Generate Shipping Label&quot;">​</a></h2><p>Both admin and seller can generate the shipping label for the fulfilled orders. You can configure the shipping Label details from the admin panel&gt;&gt;Sendle Configuration.</p><p>Seller needs to follow the below-given steps to generate shipping labels for fulfilled orders:</p><ul><li>Login to Multi-vendor <strong>Seller</strong> <strong>Panel</strong>.</li><li>After that, Go to <strong>Orders</strong>.</li><li>Visit the <strong>Order Listing</strong> section.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/viewordersendle.webp" alt="Order-Seller-•-Multivendor-MarketPlace"></p><ul><li>Now, accept the Order.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/orderfullpage.webp" alt="Screenshot-2020-10-07T181437.479"></p><p>Clicking the Fulfill button, you need to select the <strong>Sendle</strong> as the shipping method.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Screenshot-2020-10-07T181621.086-1200x516.png" alt="Screenshot-2020-10-07T181621.086"></p><p>Now, the seller will generate/print shipping label from &quot;Additional Order Details&quot; section.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/generateshiipinglabel.webp" alt="Order-Details-Seller-•-Multivendor-MarketPlace"></p><p>Thus, the shipping label will be generated automatically for the fulfilled orders. Thus, the seller can easily print the shipping label from here:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/10/Screenshot-2020-10-07T182737.403.png" alt="Screenshot-2020-10-07T182737.403"></p><p>That&#39;s all about the Sendle Shipping Feature App.</p><h2 id="demo" tabindex="-1">DEMO <a class="header-anchor" href="#demo" aria-label="Permalink to &quot;DEMO&quot;">​</a></h2><p>Link to check the demo of Multi-vendor Marketplace app for Shopify: <a href="https://multivendor-marketplace-5.myshopify.com/" target="_blank" rel="noreferrer">https://multivendor-marketplace-5.myshopify.com</a></p>',63)])])}const u=t(a,[["render",i]]);export{g as __pageData,u as default};
